import React from 'react';
import './App.css';


import CardView from 'CardView';

export default class CardHandView extends React.Component {

	constructor(props) {
  		super(props);
  		console.log("ViewCard: ", this.props.cards);
	}

	render() {
		return (
			<div>
				{this.props.cards.map((value, key) => (<CardView card={value.image()} key={key}/>))}
			</div>
		)
	}
}
